import ExpensiveItem from "./components/ExpensiveItem";


function App() {
  const expenses = [
    {
      id: 'e1',
      name: 'realmadrid',
      price: 94.12,
      des: new Date(2020, 7, 14),
    },
    { id: 'e2', name: 'New TV', price: 799.49, des: new Date(2021, 2, 12) },
    {
      id: 'e3',
      name: 'Elnasr',
      price: 294.67,
      des: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      name: 'Manshister city',
      price: 450,
      des: new Date(2021, 5, 12),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpensiveItem>this is also visable</ExpensiveItem>
    </div>
  );
}

export default App;
